Why is this unhelpful? ü§î

Because we're not good judges of what will make us happy!  Psychologists Timothy Wilson and Daniel Gilbert found that people do not accurately predict how they may feel in the future and instead tend to overestimate how positive or negative they will feel about certain situations. 

A great example of this is buying a new fancy car, we may anticipate immense long-lasting happiness from this purchase, but the joy of new ownership soon dissipates. üöó 
 
Wilson and Gilbert's research found that we as humans  are so good at adapting to life changes that the happiness or sadness we gain from monumental events such as marriage, the birth of a child, losing a spouse, or winning the lottery usually diminishes after a short period of time and we return to our set point. üìà

So what we're getting at here is that humans are not good predictors of what will make us happy.  When we get what we thought we wanted, we're not always as happy as we thought we would be, and if we are the effects are much shorter than anticipated.

So what's the solution to this?  Focus on the now!  Yes we want to have goals and things we're striving for, but if we're always banking on being happy in the future when XYZ happens instead of in the moment we're setting ourselves up for a lot of disappointment. If we are able to enjoy the good things as they come and savor the present moment without expecting any event to radically make our lives better or worse this can be an effective way to build and maintain happiness. üôÇ

